import React from 'react';
import './NewCollections.css';
import data_product from '../Assets/data_product';

import Item from '../Assets/Popular/Item';

 // Ensure Item component is imported correctly

export const NewCollections = () => {
  return (
    <div className="newcollections">
      <h1>NEW COLLECTIONS</h1>
      <hr />
      <div className="collections">
      {data_product.map((item, i) => (
  <div className="item" key={i}>
    <img src={item.image} alt={item.name} />
    <h2>{item.name}</h2>
    <p>
      <span className="new-price">${item.new_price}</span>
      {item.old_price && <span className="old-price">${item.old_price}</span>}
    </p>
  </div>
))}

    
      </div>
    </div>
  );
};
